import React from 'react';
import UsersTable from '../components/UsersTable';
import '../assets/css/people.css';

function Home() {
    const baseUser = {
        photo: 'https://sun1-94.userapi.com/s/v1/ig2/6F6D98xB9-_xMDx59wqOx4AbxMe59NDTQG8rBvMVJxCaysx3S4V0gBzgbHos_V5e2fMwNO1YgjqMELemmP3nd-5g.jpg?quality=95&crop=0,0,482,482&as=32x32,48x48,72x72,108x108,160x160,240x240,360x360,480x480&ava=1&u=9ORr4tv6F3UUjFkDnYKwTBdeIzjG31J_7PvH23wLTMM&cs=200x200',
        name: 'John Doe',
        age: '29'
    };

    const users = Array.from({ length: 50 }, (_, index) => ({
        ...baseUser,
        id: index + 1 // Добавляем уникальный id для каждого пользователя
    }));

    return (
        <div className={'content'}>
            <div className={'grid'}>
                <div className={'white_box tabled'}>
                    <div className={'flex'}>
                        <UsersTable users={users}/>
                    </div>
                </div>
                <div className={`white_box profile_card overflowed`}>
                    <div className={"header"}>
                        <h1>{users[0].name}</h1>
                        <span>Registred at 8 june 2022</span>
                    </div>
                    <div className={"flex"}>
                        <img src={users[0].photo}/>
                        <div className="flex-table">
                            <div className="flex-row">
                                <div className="flex-cell">Возраст:</div>
                                <div className="flex-cell">31</div>
                            </div>
                            <div className="flex-row">
                                <div className="flex-cell">Дата рождения:</div>
                                <div className="flex-cell">2 марта 1993 года</div>
                            </div>
                            <div className="flex-row">
                                <div className="flex-cell">Email:</div>
                                <div className="flex-cell">nikandtas@gmail.com</div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Home;
